import React, { useState } from "react";
import "./cadastro.css";

import { IoMdCalendar } from "react-icons/io";


const Cadastro = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [show, setShow] = useState(false);

  const handleClick = (e) => {
    e.preventDefault();
    setShow(!show);
  };
  return (
    <div className="cadastro">
      <div className="Cadastro-title">
        <h1>Cadastro</h1>

        <div className="cadastro-InputNome">
          <MdEmail />
          <input
            type="nome"
            placeholder="Digite seu nome completo"
          />
        </div>

        <div className="cadastro-InputData">
          <IoMdCalendar/>

        </div>

        <div className="cadastro-InputPassword">
          <MdLock />
          <input
            type={show ? "text" : "password"}
            placeholder="Digite sua senha"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <div className="cadastro-eye">
            {show ? (
              <HiEye size={20} onClick={handleClick} />
            ) : (
              <HiEyeOff size={20} onClick={handleClick} />
            )}
          </div>
        </div>

        <button className="button-entrar" type="submit">Entrar</button>

        <h4>NÃ£o possui conta? </h4>
        <button type="submit">Cadastrar</button>
      </div>
    </div>
  );
};

export default Login;
